export default {
  name: 'home',
  data: function data() {
    return {
      items: ''
    };
  },
  created: function created() {
    var vm = this;
    this.$axios.get('/api.php?op=getjzlist').then(function (response) {
      if (response.data.code == 1) {
        vm.items = response.data.data;
      }
    }).catch(function (error) {
      console.log(error);
    });
    this.wxConfig();
  },
  methods: {
    pipeData: function pipeData(index) {
      if (!this.items[index].img_url) {
        this.$router.push({
          path: '/submit',
          name: 'submit',
          query: {
            pipedata: JSON.stringify(this.items[index])
          }
        });
      } else {
        this.$router.push({
          path: '/detail',
          name: 'detail',
          query: {
            pipedata: JSON.stringify(this.items[index])
          }
        });
      }
    }
  }
};
